import React from 'react';
import ReactImageZoom from 'react-image-zoom';

function App() {
  const props = {
    width: 400,
    height: 250,
    zoomWidth: 500,
    zoomLensStyle:'opacity: 0.4;background-color: gray;',
    zoomPosition:'bottom',
    img: require('./1.jpg')}
  return (
    <div className="App">
      <ReactImageZoom {...props} />
    </div>
  );
}

export default App;
